【テスコム スタイルアップ ロールブラシヘアーアイロン ブラック THR6-Kの詳細】<br>●ロールブラシで簡単スタイリング。<br>
●セラミックコーティング。<br>
●最高温度190度。<br>
●クイックコードバンド付き。コードをすっきりまとめます。<br>
●国内・海外両用タイプ。AC100V-240Vの電圧地域で使用可能です。自動電圧切替式。<br><br>

【仕様】<br>
本体寸法：高さ43mm、幅212mm、奥行43mm<br>
本体質量（重量）：200g<br>
消費電力：22Ｗ　AC100－240V（自動電圧切替）<br>
スイッチ：電源スイッチ「ON-OFF」<br>
アイロン径：22mm<br>
付属品：クイックコードバンド<br><br>

【内容量】<br>
1個<br><br>

【販売元】<br>
テスコム<br>
東京都品川区西五反田5-5-7テスコム五反田ビル<br>
お問い合わせ先：0120-343-122<br><br>

【商品区分】<br>
家電<br><br>

[ヘアーアイロン/TESCOM]

<br><br><br><hr>
広告文責：株式会社モリキ<br>
電話：0269-38-0611<br><style type="text/css">
